function formatForStr(str) {
  if (str.length === 0) return ""
  let html = ""
  for (let ch of str) {
    switch (ch) {
      case " ":
        html += "&nbsp;"
        break
      case "\n":
        html += "<br>"
        break
      default:
        html += ch
        break
    }
  }
  return html + "<br><br>"
}

